"    <div id=\"topicTitle\">",
"     Patient information: Metatarsalgia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/metatarsalgia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H275288226\">",
"      <span class=\"h1\">",
"       What is metatarsalgia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Metatarsalgia is a condition that causes pain in the ball of the foot. It happens when there is inflammation in the metatarsals, which are the foot bones closest to the toes (",
"      <a class=\"graphic graphic_figure graphicRef83480 \" href=\"UTD.htm?26/61/27600\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Different things can cause metatarsalgia. It can happen in people who run or do other activities that put a lot of pressure on the feet. It can also happen in people who wear tight-fitting shoes a lot or have certain foot problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H275288241\">",
"      <span class=\"h1\">",
"       What are the symptoms of metatarsalgia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Metatarsalgia causes pain in the ball of the foot. The pain can also spread to the toes. The pain is usually worse when people run or do other activities that put pressure on their feet.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H275288256\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Probably not. Your doctor or nurse should be able to tell if you have metatarsalgia by learning about your symptoms and doing an exam. He or she might order an X-ray of your foot to make sure your symptoms are not caused by another condition.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H275288271\">",
"      <span class=\"h1\">",
"       How is metatarsalgia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment for metatarsalgia usually involves 1 or more of the following:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Resting your foot &ndash; Give your foot a chance to heal by resting. But don&rsquo;t completely stop being active. You can do activities that put less pressure on your feet, such as swimming.",
"       </li>",
"       <li>",
"        Putting ice on your foot when it hurts or after activities that cause pain &ndash; You can put a cold gel pack, bag of ice, or bag of frozen vegetables on the painful area every 1 to 2 hours, for 15 minutes each time. Put a thin towel between the ice (or other cold object) and your skin.",
"       </li>",
"       <li>",
"        Taking a pain-relieving medicine, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"         acetaminophen",
"        </a>",
"        (sample brand name: Tylenol&reg;),",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil&reg;, Motrin&reg;), or",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?43/35/44597?source=see_link\">",
"         naproxen",
"        </a>",
"        (sample brand names: Aleve&reg;, Naprosyn&reg;).",
"       </li>",
"       <li>",
"        Wearing sturdy shoes and a metatarsal insert &ndash; Sneakers with a lot of cushion and good arch and heel support are best. Your doctor will also probably recommend that you put a padded insert called a &ldquo;metatarsal pad&rdquo; into your shoe.",
"       </li>",
"       <li>",
"        Wearing arch supports or special shoe inserts called &ldquo;orthotics&rdquo; that are made to fit your foot",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In most cases, these treatments help improve symptoms. But if your symptoms don&rsquo;t improve, your doctor might talk with you about other options. This might involve surgery to correct the position of your foot bones.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H275288286\">",
"      <span class=\"h1\">",
"       How long does metatarsalgia take to heal?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Metatarsalgia can take weeks to months to heal, depending on the cause and your symptoms.",
"     </p>",
