"   <p class=\"headingAnchor\" id=\"H31\">",
"    <span class=\"h1\">",
"     SUMMARY AND RECOMMENDATIONS",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      The four essential components of asthma management are: routine monitoring of symptoms and lung function, patient education, control of trigger factors and amelioration of comorbid conditions, and pharmacologic therapy (See",
"      <a class=\"local\" href=\"#H2\">",
"       'Components of asthma management'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      The goals of asthma treatment are to reduce impairment from symptoms, minimize risk of the various adverse outcomes associated with asthma (eg, hospitalizations, loss of lung function), and minimize adverse effects from asthma medications. (See",
"      <a class=\"local\" href=\"#H3\">",
"       'Goals of asthma treatment'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Effective asthma management requires a preventative approach, with regularly scheduled visits during which symptoms are assessed, pulmonary function is monitored, medications are adjusted, and ongoing education is performed. (See",
"      <a class=\"local\" href=\"#H6\">",
"       'Monitoring patients with asthma'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Patients should learn to monitor asthma control at home (eg, frequency and severity of dyspnea, cough, chest tightness, and",
"      <a class=\"drug drug_general\" href=\"UTD.htm?15/61/16344?source=see_link\">",
"       albuterol",
"      </a>",
"      use). Patients with moderate to severe asthma and those with poor perception of increasing asthma symptoms may also benefit from assessment of their peak expiratory flow rate at home. A personalized asthma action plan should be provided with detailed instructions on how to adjust asthma medications based upon changes in symptoms",
"      <span class=\"nowrap\">",
"       and/or",
"      </span>",
"      lung function (",
"      <a class=\"graphic graphic_form graphicRef55900 \" href=\"UTD.htm?36/39/37498\">",
"       form 2",
"      </a>",
"      ). (See",
"      <a class=\"local\" href=\"#H12\">",
"       'Patient education'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Environmental triggers and co-existing conditions that interfere with asthma management should be identified and addressed for each patient. (See",
"      <a class=\"local\" href=\"#H14\">",
"       'Controlling triggers and contributing conditions'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      Pharmacologic therapy varies according to asthma severity and asthma control. Asthma control is judged based on the current level of symptoms, FEV",
"      <sub>",
"       1",
"      </sub>",
"      or PEFR values, and number of exacerbations requiring oral glucocorticoids per year (",
"      <a class=\"graphic graphic_table graphicRef58247 \" href=\"UTD.htm?32/48/33549\">",
"       table 11",
"      </a>",
"      and",
"      <a class=\"graphic graphic_table graphicRef71181 \" href=\"UTD.htm?26/62/27629\">",
"       table 12",
"      </a>",
"      and",
"      <a class=\"graphic graphic_table graphicRef80908 \" href=\"UTD.htm?9/40/9869\">",
"       table 13",
"      </a>",
"      ). (See",
"      <a class=\"local\" href=\"#H16\">",
"       'Categories of asthma severity'",
"      </a>",
"      above and",
"      <a class=\"medical medical_review\" href=\"UTD.htm?36/30/37354?source=see_link\">",
"       \"Chronic asthma in children younger than 12 years: Controller medications\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      A stepwise approach to therapy is recommended, in which the dose of medication, the number of medications, and the frequency of administration are increased as necessary and decreased when possible (",
"      <a class=\"graphic graphic_figure graphicRef56729 \" href=\"UTD.htm?43/33/44563\">",
"       figure 2",
"      </a>",
"      and",
"      <a class=\"graphic graphic_figure graphicRef67459 \" href=\"UTD.htm?1/41/1684\">",
"       figure 3",
"      </a>",
"      and",
"      <a class=\"graphic graphic_figure graphicRef76669 \" href=\"UTD.htm?36/40/37506\">",
"       figure 4",
"      </a>",
"      ). (See",
"      <a class=\"local\" href=\"#H22\">",
"       'Initiating therapy in previously untreated patients'",
"      </a>",
"      above.)",
"     </li>",
"     <li>",
"      At each return visit, the patient's asthma control is evaluated (",
"      <a class=\"graphic graphic_table graphicRef53233 \" href=\"UTD.htm?38/33/39453\">",
"       table 14",
"      </a>",
"      ). If the asthma is not well-controlled, therapy should be \"stepped-up.\" If the asthma is well-controlled, therapy can be continued or possibly \"stepped-down\" to minimize medication side effects. (See",
"      <a class=\"local\" href=\"#H27\">",
"       'Assessing control to adjust therapy'",
"      </a>",
"      above and",
"      <a class=\"medical medical_review\" href=\"UTD.htm?36/30/37354?source=see_link\">",
"       \"Chronic asthma in children younger than 12 years: Controller medications\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      Guidelines for when to refer a patient to a pulmonologist or an",
"      <span class=\"nowrap\">",
"       allergist/immunologist",
"      </span>",
"      are provided. (See",
"      <a class=\"local\" href=\"#H29\">",
"       'When to refer'",
"      </a>",
"      above.)",
"     </li>",
"    </ul>",
"   </p>",
