var title_f8_37_8796="Sudden sensorineural loss";
var content_f8_37_8796=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F78516&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F78516&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Main causes of sudden sensorineural hearing loss (SSNHL)*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Infections",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Viral cochleitis associated with herpesviruses, parainfluenza virus, influenza, mumps, measles, rubella, or HIV; bacterial meningitis; Mycoplasma pneumoniae infection; Lyme disease; tuberculosis, syphilis, or fungal infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Ototoxic drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Aminoglycosides, vancomycin, erythromycin, loop diuretics, antimalarials, cisplatin, sildenafil, cocaine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Neoplasms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acoustic neurinoma; meningeal carcinomatosis; lymphoma, leukemia, or plasma cell dyscrasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Trauma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Head injury, barotraumas; noise exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Autoimmune disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Autoimmune inner ear disease; Cogan's syndrome; Susac syndrome; systemic lupus erythematosus; antiphospholipid antibody sydrome; rheumatoid arthritis; Sj&ouml;gren's syndrome; relapsing polychondritis; vasculitides (polyarteritis nodosa, Beh&ccedil;et's disease, Kawasaki disease, granulomatosis with polyangiitis (Wegener's), temporal arteritis, or primary central nervous system vasculititis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Vascular disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vertebrobasilar cerebrovascular accident or transient ischemic attack; cerebellar infarction; inner ear hemorrhage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Varied causes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Meniere disease, otosclerosis; Paget's disease; multiple sclerosis; sarcoidosis; hypothroidism; idiopathic SSNHL",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * In many of the conditions listed, SSNHL can be the presenting manifestation of the disease. Sometimes, both ears may be affected simultaneously.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Schattner A, Halperin D, Wolf D, Zimhony O. Enteroviruses and sudden deafness. CMAJ 2003; 168:1421. Copyright &copy; 2003 Canadian Medical Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
