var title_f8_37_8797="Rx Culture neg endocarditis";
var content_f8_37_8797=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F70094&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F70094&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggested regimens for therapy of culture-negative native valve endocarditis*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\" colspan=\"2\" rowspan=\"1\">",
"       American Heart Association",
"      </td>",
"      <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"       British Cardiac Society",
"      </td>",
"      <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"       European Society of Cardiology",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2\">",
"       Adult (for patients with normal renal function)",
"      </td>",
"      <td class=\"subtitle2\">",
"       Pediatric (not to exceed dose of normal adult)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <p>",
"        <strong>",
"         One of the following:",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin-sulbactam 12 g per 24 h IV in 4 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin sulfate&bull; 3 mg/kg per 24 h IV or IM in 3 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Vancomycin&Delta; 30 mg/kg per 24 h IV in 2 equally divided doses for 4-6 wks; not to exceed 2 g per 24 h unless concentrations in serum are inappropriately low",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin&bull; 3 mg/kg per 24 h IV or IM in 3 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ciprofloxacin 1000 mg per 24 h PO or 800 mg per 24 h IV in 2 equally divided doses for 4 to 6 wks",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        <strong>",
"         One of the following:",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin-sulbactam 300 mg/kg per 24 h IV in 4 or 6 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin&bull; 3 mg/kg per 24 h IV or IM in 3 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Vancomycin&Delta; 40 mg/kg per 24 h IV in 2 or 3 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin&bull; 3 mg/kg per 24 h IV or IM in 3 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ciprofloxacin&sect; 20-30 mg/kg per 24 h IV or PO in 2 equally divided doses for 4 to 6 wks",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Vancomycin 15mg/kg IV every 12 h for 6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin 3-5 mg/kg IV or IM per 24 h in 2 or 3 equally divided doses for 2 wks",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Ampicillin-sulbactam or amoxicillin-clavulanate 12 g per 24 h IV in 4 equally divided doses for 4-6 weeks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin&bull; 3 mg/kg per 24 h IV or IM in 2 or 3 equally divided doses for 4-6 weeks",
"       </p>",
"       <p>",
"        <strong>",
"         OR",
"        </strong>",
"       </p>",
"       <p>",
"        Vancomycin&Delta; 30 mg/kg per 24 h IV in 2 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin&bull; 3 mg/kg per 24 h IV or IM in 2 or 3 equally divided doses for 4-6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Ciprofloxacin&loz;&sect; 1000 mg PO or 800 mg IV in 2 equally divided doses for 4-6 wks",
"       </p>",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IV: intravenously; IM: intramuscularly; PO: orally; h: hours; wks: weeks",
"     <br>",
"      * Patients with culture-negative endocarditis should be treated in consultation with an infectious diseases specialist; when an etiology is established (eg, serology for Coxiella [Q fever] or Bartonella are positive), therapy should be directed to the etiologic agent.",
"      <br>",
"       &bull; Renal function and serum gentamicin concentrations should be monitored at least once a week. Gentamicin dosage adjusted for peak serum concentration of 3-4 &micro;g/mL, trough &lt; 1 &micro;g/mL.",
"       <br>",
"        &Delta; Vancomycin therapy only recommended for patients allergic to penicillins.",
"        <br>",
"         &loz; Ciprofloxacin is not uniformly active on Bartonella spp. Addition of doxycycline is an option if Bartonella spp. is likely.",
"         <br>",
"          &sect; Use flouroquinolones with caution in patients &lt; 18 years of age.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Circulation 2005;111:3167; Clin Med 2004;4:545; Eur Heart J 2009;30:2369.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
